import React from "react";
import Style from "./home.module.scss";
import veiculos from "./veiculos.json";
import Burger from "../menuBurger";
import CheckboxFilter from "./checkboxFilter/index";
import Card from "./card";

function Home() {
  const filtrarMarcas = (veiculos) => {
    
    const setVeiculo = new Set();
    const DadosCheckbox = veiculos.filter((veiculo) => {
      const MarcaDuplicada = setVeiculo.has(veiculo.marca);
      setVeiculo.add(veiculo.marca);
      return !MarcaDuplicada;
    });
    
    console.log(veiculos) 

  }
 return (
    <>
      <Burger />
      <div className={Style.container}>
        <CheckboxFilter style={Style} veiculos={veiculos} DadosCheckbox={DadosCheckbox} />
        <Card Style={Style} veiculos={veiculos} />
      </div>
    </>
  );
}
export default Home;
